import React from "react";
import { FaTrashAlt } from "react-icons/fa";

const ListItem = (props) => {
  return (
    <div className="list-item">
      <div className="list-item-action" onClick={props.onDeleteClick}>
        <FaTrashAlt />
      </div>
    </div>
  );
};

export default ListItem;
